fn main() {
    let mut count = 0;
    let lines = INPUT.lines().map(|l| l.chars().collect::<Vec<_>>()).collect::<Vec<_>>();
    let X = lines[0].len();
    let Y = lines.len();
    for y in 0..(Y-2) {
        for x in 0..(X-2) {
            if lines[y+1][x+1] != 'A' {
                continue;
            }
            match (
                lines[y][x],
                lines[y][x+2],
                lines[y+2][x+2],
                lines[y+2][x]
            ) {
                ('M', 'M', 'S', 'S') => count+=1,
                ('S', 'M', 'M', 'S') => count+=1,
                ('S', 'S', 'M', 'M') => count+=1,
                ('M', 'S', 'S', 'M') => count+=1,
                _ => {}
            }
        }
    }
    dbg!(count);
}

